import React from 'react';

// interface count {
//     count: number;
// }

function ProjectCountPage() {
    const [count, setCount] = React.useState(0);
    const handleClick = () => {
        props.count += 1;
    }
    return(
        <div>
            <div>
                You have {props.count} Projects
            </div>;
            <button onClick={handleClick}>
                Click me
            </button>
        </div>
    );
}

export default ProjectCountPage;
